import React,{useState} from 'react';
import './App.css';

function App() {
  const [todos,setTodos] = useState(['Take dogs for a walk', 'Take the rubbish out']);
  const [input, setInput] = useState('');
  return (
    <div className="App">
      <h1>hello</h1>
      <input value = {input}/>
      <button>Add Todo</button>
      <ul>
      {todos.map(todo => (
        <li>{todo}</li>
      ))}
      </ul>
    </div>
  );
}

export default App;
